import React from "react";
import styled from "styled-components";

const Div = styled.div`
  color: white;
  display: flex;
  flex-direction: row;
  justify-content: center;
`;

const content = styled.div`
    margin-left:10px;
    margin-rig: 10px
`;

const Footer = () => {
  return (
    <Div>
      <content>Created By: 이정운</content>
      <div>|</div>
      <div>제휴제안</div>
      <div>|</div>
      <div>이용약관</div>
      <div>|</div>
      <div>고객센터</div>
    </Div>
  );
};

export default Footer;
